main();

function main() {
	console.log("[main inicio...] " + getDateTime());
	var produtoList = document.getElementsByClassName("oferta-title")
	var precoList = document.getElementsByClassName("col-sm-5 col-xs-12 preco");
	var galaxy = "galaxy s6";
	try {
		if (produtoList != null) {
			for (var i = 0; i < produtoList.length; i++) {
				produto = produtoList[i].innerText;
				preco = precoList[i].innerText;
				if (produto.toUpperCase().includes(galaxy.toUpperCase())) {
					precoComp = preco.substr(3, preco.lenght);
					if (precoComp <= "1.900,00") {
						playalert();
						notifyMe();
					}	
				}
			}
		}
	}
	catch(err) {
		console.log(err.message);
	}	
	console.log("[main fim...] " + getDateTime());
	console.log("[reolad em 2m...] " + getDateTime());
	window.setTimeout(relaoad, 120000);
}

function relaoad() {
	console.log("[reload]" + getDateTime());
	location.reload();
	
}

function playalert() {
var snd = new  Audio("data:audio/wav;base64,");
    snd.play();
}

function getDateTime() {
	return new Date().toLocaleString();
}

function notifyMe() {
	if (Notification.permission !== "granted")
		Notification.requestPermission();
	else {
		var notification = new Notification('O___O    ¯\_(ツ)_/¯    ( ͡°﻿ ͜ʖ ͡°)', {
		  icon: 'https://pbs.twimg.com/profile_images/669960721199968256/csk60aSK_bigger.jpg',
		  body: "Corre minino!",
		});
	}
	notification.onclick = function () {
		window.open("http://www.ofertaesperta.com/");      
	};
}